import React, { Component } from 'react'

import 'bootstrap/dist/css/bootstrap.min.css'
import '@fortawesome/fontawesome-free/css/all.min.css'

import LineChart from '../Charts/LineChart/LineChart';

export default class Card extends Component {
   render() {

      const { headerText, bodyText, cardText } = this.props;

      return (
         <div className="col-sm-6 col-xs-6 mt-4">
            <div className="card bg-dark text-white">
               <div className="card-header">
                  <span class="fas fa-chart-line header-icon"></span>
                  {headerText}
                  <span class="fa fa-angle-down float-right header-icon text-secondary"></span>
                  <span className="fa fa-toggle-on float-right header-icon text-secondary"></span>
               </div>
               <div className="card-body">
                  <LineChart></LineChart>
                  <p class="card-text">
                     {cardText}
                  </p>
               </div>
            </div>
         </div>
      )
   }
}
